  base: *id011
  body: 'numpy API < 1.7 does not support NPY_ARRAY_F_CONTIGUOUS.or PyArray_IS_F_CONTIGUOUS.
    Supporting old APIs is useful as users tend to ship modern numpy.i files to compile
    against possibly older numpy installations.


    I tested this fix by searching for the introduction of both constants (numpy 1.7),
    and compiling against numpy 1.3 and 1.10. This ought to be more than sufficient
    for this simple change. Note that the code for <=1.7 is equal to what used to
    be there (actually until 1.9).

    '
